"use strict";
(m, rest) => {
    const destructuringMatch = rest.match(/}=.+/);
    if (destructuringMatch) {
        const defaultValueMatch = m.match(canonicalizeMatch(/hideNote:(\i)=!?\d/));
        return defaultValueMatch ? `hideNote:${defaultValueMatch[1]}=!0` : m;
    }
    return "hideNote:!0";
};

